LL,0,'plain','',0,0),(63,'stripe_applepay_q1_2022','marketing','en_US','Increase conversions with Apple Pay – just like Thomas does','Read the inspirational story of <a href=\"https://woocommerce.com/posts/incredible-story-of-thomas-trendy-socks-down-syndrome-entrepreneur/?utm_source=product&amp;utm_medium=inboxnotification&amp;utm_campaign=apple-pay\" target=\"_blank\">Thomas\'s Trendy Socks</a> and see how he’s using Apple Pay to provide customers with the fast, secure checkout experience they love. You can, too – ready to turn more visitors into buyers? Accept Apple Pay by selecting Enable express checkouts in Settings &gt; Payments &gt; Stripe.','info','{}','pending','woocommerce.com','2022-03-11 07:41:55',NULL,0,'plain','',0,0),(64,'square_applepay_q1_2022','marketing','en_US','Increase conversions with a faster checkout experience','By enabling Apple Pay in Square, your customers can complete purchases quickly and securely with a single touch or a glance – no lengthy checkout forms necessary. Accept Apple Pay by enabling Digital Wallets within Settings &gt; Payments &gt; Square.','info','{}','pending','woocommerce.com','2022-03-11 07:41:55',NULL,0,'plain','',0,0),(65,'woocommerce-core-paypal-march-2022-updated','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy PayPal Standard security updates for stores running WooCommerce (version 3.5 to 6.3). It’s recommended to disable PayPal Standard, and use <a href=\"https://woocommerce.com/products/woocommerce-paypal-payments/\" target=\"_blank\">PayPal Payments</a> to accept PayPal.','info','{}','pending','woocommerce.com','2022-03-11 07:41:55',NULL,0,'plain','',0,0),(66,'woocommerce-core-paypal-march-2022-updated-nopp','update','en_US','Security auto-update of WooCommerce','<strong>Your store has been updated to the latest secure version of WooCommerce</strong>. We worked with WordPress to deploy security updates related to PayPal Standard payment gateway for stores running WooCommerce (version 3.5 to 6.3).','info','{}','unactioned','woocommerce.com','2022-03-11 07:41:55',NULL,0,'plain','',0,0),(67,'lead_gen_existing_customers_1','marketing','en_US','Talk to a consultant','As your business grows, you want to optimize costs, streamline operations, and sell more. We can help. Talk to us about how you can get the most out of WooCommerce.','info','{}','pending','woocommerce.com','2022-03-30 01:45:19',NULL,0,'plain','',0,0),(68,'pinterest_03_2022_update','marketing','en_US','Your Pinterest for WooCommerce plugin is out of date!','Update to the latest version of Pinterest for WooCommerce to continue using this plugin and keep your store connected with Pinterest. To update, visit <strong>Plugins &gt; Installed Plugins</strong>, and click on “update now” under Pinterest for WooCommerce.','info','{}','pending','woocommerce.com','2022-03-30 01:45:19',NULL,0,'plain','',0,0),(69,'wc-admin-navigation-nudge','info','en_US','You now have access to the Quản lý bán hàng navigation','We’re introducing a new navigation for a more intuitive and improved user experience. You can enable the beta version of the new experience in the Advanced Settings. Enable it now for your store.','info','{}','unactioned','woocommerce-admin','2022-04-20 13:16:10',NULL,0,'plain','',0,0),(70,'wc-admin-update-store-details','info','en_US','Edit your store details if you need to','Nice work completing your store profile! You can always go back and edit the details you just shared, as needed.','info','{}','unactioned','woocommerce-admin','2022-04-20 13:16:10',NULL,0,'plain','',0,0);
